import 'dart:convert';
import 'dart:io';

import 'package:flutter/foundation.dart';
import 'package:flutter/material.dart';
import 'package:flutter/services.dart';
import 'package:image_picker/image_picker.dart';
import 'package:path_provider/path_provider.dart';

class HomePage extends StatefulWidget {
  @override
  _HomePageState createState() => _HomePageState();
}

class _HomePageState extends State<HomePage> {
  TextEditingController _base64Controller = TextEditingController();
  final ImagePicker _picker = ImagePicker();
  File? _imageFile;
  String base64Image = "";

  void _pickImageBase64() async {
    try {
      final XFile? image = await _picker.pickImage(source: ImageSource.gallery);
      if (image == null) return;
      Uint8List imagebytes = await image!.readAsBytes();
      String _base64String = base64.encode(imagebytes);

      Directory appDocumentsDirectory = await getApplicationDocumentsDirectory();

      File logFile = File('${appDocumentsDirectory.path}/log.txt');

      logFile.writeAsStringSync(_base64String);
      print('String written to ${logFile.path}');

      final imageTemp = File(image.path);
      setState(() {
        this._imageFile = imageTemp;
        base64Image = "";
      });
    } on PlatformException catch (e) {
      if (kDebugMode) {
        print('error');
      }
    }
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Text('Image Picker Example'),
      ),
      body: Padding(
        padding: const EdgeInsets.all(16.0),
        child: Column(
          mainAxisAlignment: MainAxisAlignment.start,
          children: [
            TextField(
              controller: _base64Controller,
              decoration:
                  InputDecoration(labelText: 'Enter base64-encoded image'),
            ),
            SizedBox(height: 20),
            ElevatedButton(
              onPressed: _pickImageBase64,
              child: Text('Image to Base64'),
            ),
            _imageFile == null
                ? Container()
                : Image.file(
                    _imageFile!,
                    width: 200,
                    height: 200,
                  ),
            Image.memory(
              base64Decode(base64Image),
              width: 200,
              height: 200,
              fit: BoxFit.cover,
            )
          ],
        ),
      ),
    );
  }
}
